import { makeStyles } from "@material-ui/core/styles";
export default makeStyles(theme => ({
  img: {
    width: "50px",
    height: "50px",
    filter: "invert(44%) sepia(81%) saturate(1101%) hue-rotate(160deg) brightness(93%) contrast(101%)"
  }
}));
